import {createBrowserRouter, RouterProvider} from "react-router-dom";
import Home from "./pages/Home";

const routes = createBrowserRouter([
  {path: "/", exact: true, name: "Home", element: <Home />},
]);


function App() {
  return <RouterProvider router={routes}/>;
}

export default App;
